def add(x: int, y: int):
    """Add two numbers x and y
    >>> add(2, 3)
    5
    >>> add(5, 7)
    12
    """
    if x == 0 or y == 0:
        return 0
    if x < y:
        return add(y, x - y)
    return x + add(y, x - y)
